import React from 'react';

export default function Main({items}) {
    
    console.log(items);
    const listItems = items.map((item) => {
        <li>{item}</li>
    })

    return(
        <div className='main-cont'>           
            <ul>
                {listItems}
            </ul>
        </div> 
    )
}
